'use client';
import { jsx } from 'react/jsx-runtime';
import { forwardRef } from 'react';

const DropdownList = forwardRef(function DropdownList({ className, ...rest }, ref) {
    return jsx("ul", { ref: ref, ...rest });
});

export { DropdownList };
